Add the new variable to responses.json's "vars" object ~ Fill in the default values ~ If NSFW, be sure to set "spiciness"~ Use the variable in existing or new messages ~ For instance, here's a minimal example "furniture" variable that is set with CARGO_MOMMYS_FURNITURES~ ü™ë { "vars": { "furniture": { "defaults": ["chair", "desk"] }, }
} and here's how you might use it~ { "moods": { "chill": { "positive": [ "thanks for helping build {role}'s {furniture}~" ], "negative": [ "ouch! {role} stubbed {pronoun} toe on the {furniture}!" ] } }
} That's it, no code needs to be changed~ üíï
